(10216, 8523, 1179, 1, '59th Street', '', '2004-10-05 00:00:00', 0000, 20, 0, 4, '', 'When the rain came down on 59th Street\nWe were standing outside of the hotel\nWhen the rain came down on 59th Street\nI didn''t mind\nI didn''t mind at all\n\nWe were good friends when I told you I was feeling more\nAnd you told me you didn''t feel the way I do\nThen the rain came down on 59th Street\nI said I didn''t mind\nI didn''t mind at all\nOh, I didn''t mind at all\nOh, I didn''t mind\nI didn''t mind at all\nWhen you told me that\nYou didn''t want me to fall for you\nNothing I could do\nI said, "Last night was a ball"\nAnd I didn''t mind at all\n\nGot into a cab\nA traffic jam, headed down the FDR\nI opened up the window and let the rain inside the car\nAnd the driver, he was nervous\nHe said, he couldn''t even see where we are\nI said, I didn''t mind at all\nOh, I didn''t mind at all\nOh, I didn''t mind\nI didn''t mind at all\nWhen you told me that\nYou didn''t want me\nI said I didn''t mind\nI didn''t mind at all\nI said I didn''t mind at all\nI didn''t mind\nI said I didn''t mind at all ', 206, '', '', '', '', '', '', 0, 1, 0, '2008-12-18 14:44:55', '2015-03-12 13:35:33', '0000-00-00 00:00:00'),
(10217, 8523, 1179, 2, 'California', '', '2004-10-05 00:00:00', 0000, 20, 0, 4, '', 'I''m moving out to California\nto find my place in the sun\nbeneath the lemon trees\nand I''m living on\noranges and gasoline\nhummingbirds humming\nhelicopters hovering\nCalifornia\nwill you take me in\nto your soft brown hills\ntiger lily thrills\nCalifornia\nPalm trees\nlook like spiders in a starry sky\nthey look as strange as I feel inside\nmy suitcase is heavy\n''cause I packed it full of childish lies\nnowhere left to run\nCalifornia here I come\nCalifornia\nI was born in a small town\nSunday school\ngrandfather pines\nSaturdays my mother\ndidn''t bother me\nmaking my mudpies under solitary skies \n', 239, '', '', '', '', '', '', 0, 1, 0, '2008-12-18 14:45:30', '2015-03-12 13:35:33', '0000-00-00 00:00:00'),
(10218, 8523, 1179, 3, 'Coney Island, USA', '', '2004-10-05 00:00:00', 0000, 20, 0, 4, '', 'underneath the rhythm of the street\nunderneath the taxis and the shuffling feet\nI fell asleep on a train.\nIn the middle of the night\nI went far away\nfrom my destination\nI missed my stop\nI slept through Carroll Station\nI went far away\nto Coney Island, U.S.A.\nI guess I had a little too much to drink\nchampagne at St. Vincent''s\nmy friend turned 84 and she said,\n"it''s too late now for me,\nbut it ain''t too late for you."\nI went far far away\nfrom my destination...\nThe boardwalk was quiet\nall the Russians were sleeping\nI thought I saw a whale up in the clouds\nits bloodshot eye upon me\nblinking through the fog\nmaybe it was just a star\nfar away ', 237, '', '', '', '', '', '', 0, 1, 0, '2008-12-18 14:46:05', '2015-03-12 13:35:33', '0000-00-00 00:00:00'),
(10219, 8523, 1179, 4, 'Stranded', '', '2004-10-05 00:00:00', 0000, 20, 0, 4, '', 'A buddha pulled up in a limousine\ntipped his fedora to the porno queen\nshe said, "Come on in, we''re shooting the scene"\nThis town is on the rocks\nlooks like a painting by Hieronymous Bosch\nall the souls are tied up in knots\nsometimes I think I''m gonna drown\nhere we are\n\nHere we are\nthe two of us\nstranded, stranded\nHere we are\nin the thick of it all\nit''s good to be in your arms\n\nI used to know a kid who wore his heart on his sleeve\na tattoo of the word sincerity\nin these days it don''t mean a thing to want to mean anything\nI think we better go and get our kicks\nI hear they''re tearing up old route 66\nmaybe we''ll move back to the sticks and listen to the trains roll by\n\nHere we are....\n\nI want to be in your arms\nthat''s the only place I feel at home\nIn this world that''s grown so hard\nI can feel it soften in your arms\nI don''t want to go through this life\nwithout you ', 227, '', '', '', '', '', '', 0, 1, 0, '2008-12-18 14:46:39', '2015-03-12 13:35:33', '0000-00-00 00:00:00'),
(10220, 8523, 1179, 5, 'The Devil and I', '', '2004-10-05 00:00:00', 0000, 20, 0, 4, '', 'Been walking off a beaten path\nfeeling like I got a gun at my back\nand the devil''s looking at me\nwaking me up in my sleep\nwhen he took my hand I didn''t understand\nthe devil was an ordinary man\nhe had a ordinary plan\nhe wanted to steal my magic power\n\nI couldn''t get the devil behind me\nnow I''m lying on my back\nlooking at the mirror in the ceiling to remind me\nI''m weak\nbut my spirit ain''t been broken\nI''m looking for my subway token\nI can hear the train coming but I ain''t out of the woods yet\n\nthe devil and I we were driftin along\non a burnin lake of love songs\nsmoke on the water\nwas the California smog\nevil, he was mean\nand he waltzed me through a liquor dream\nI was coming apart at the seams\nit was the best time I ever seen\n\nI couldn''t get the devil behind me...\n\nI''m a long way from home\nand the devil made a social call\nI''m a long way off the road\nfeeling supernatural ', 270, '', '', '', '', '', '', 0, 1, 0, '2008-12-18 14:47:18', '2015-03-12 13:35:33', '0000-00-00 00:00:00'),
