(10361, 4710, 1140, 1, '海星星也有抓到天上星星的那一天', '海星星也有抓到天上星星的那一天\r\n這是一個追逐虛幻夢想的故事\r\n一顆漂流在海面上的海星\r\n每天看著高掛在天空上閃亮的星星\r\n他一直夢想著能夠抓住天上的星星\r\n直到有一天他看見星星離他越來越近\r\n他看著她 猶豫著 煩惱著\r\n好不容易\r\n他決定鼓起勇氣去捕抓他的夢想\r\n沒想到 當他伸出雙手\r\n正要擁抱住她的時候\r\n才發現\r\n原來在他面前的星星\r\n只是天空上的星星倒映在海面上的倒影\r\n這一切都不是真實的\r\n其實他還是離她很遙遠', '2008-12-26 00:00:00', 0000, 15, 0, 7, '滿天星星黑夜裡\r\n海平面風平浪靜\r\n銀色光芒照映在\r\n一片心動的海洋 \r\n\r\n五角形的小小海星\r\n看著天空想著你\r\n淡藍色水汪汪眼\r\n吸引了天上的星星 \r\n\r\n神奇的魅力 (只為妳)\r\n\r\n藍藍的天 海的星 海星星在黑夜裡哭泣\r\n抓不住的夢想 oh 兩顆寂寞的星星\r\n\r\n藍藍的天 海的星 星星的眼淚落在海裡\r\n小小的戀愛 oh 隨著時間慢慢的\r\n\r\n自以為抓到了夢想\r\n卻如幻影般消逝去\r\n海面上星星倒影\r\n隨波散去不留痕跡 \r\n\r\n失去了意義 只為妳\r\n\r\n', '', 339, '', '林奕廷', '張嫚珈', '坦娜普', 'Goodie Music', '', 0, 1, 0, '2008-12-19 02:36:23', '2015-03-12 13:35:38', '0000-00-00 00:00:00'),
(10362, 4710, 1140, 2, '白色與黑色的動物', '在廣大的動物生態裡\r\n每種動物都有著不一樣的外表\r\n白色與黑色\r\n單純與清新的兩種顏色\r\n佔動物生態裡的一大部分\r\n不過\r\n它們除了身上簡單的白色與黑色外\r\n還有些什麼顏色在它們的心裡\r\n它們除了身上對比的白色與黑色\r\n人類又加了些什麼顏色在它們身上', '2008-12-26 00:00:00', 0000, 15, 0, 7, '黑白乳牛   白頸狐猴\r\n白色黑色快快樂樂\r\n黑白疣猴   大麥町狗   \r\n白色黑色不算什麼\r\n\r\n黑白斑馬  小食蟻獸\r\n白色黑色悠悠哉哉\r\n黑白貓熊  台灣黑熊\r\n白色黑色還有什麼\r\n\r\n意見那麼多   誰才對呀\r\n什麼都不說   來猜拳吧\r\n剪刀石頭還有布   啊~~嘿\r\n\r\n黑熊出布  貓熊出布\r\n唉呀   一個平手\r\n跳跳轉轉  轉圈圈\r\n再猜一次\r\n\r\n黑熊石頭  貓熊石頭\r\n唉呀  還是朋友\r\n跳跳轉轉  快樂地\r\n歌  唱  (啦啦   還有  還有  笑  笑  羊  啦)\r\n\r\n啦啦啦啦\r\n啦啦啦啦\r\n啦啦啦啦\r\n啦啦啦啦  啦啦\r\n啦啦啦啦\r\n啦啦啦啦\r\n啦啦啦啦\r\n\r\n黑白鯨魚  阿德企鵝\r\n白色黑色悠悠哉哉\r\n黑白貓熊  台灣黑熊\r\n白色黑色還有什麼\r\n', '', 326, '', '林奕辰', '林奕辰.林奕廷', '坦娜普', 'Goodie Music', '', 0, 1, 0, '2008-12-19 02:38:18', '2015-03-12 13:35:38', '0000-00-00 00:00:00'),
(10363, 4710, 1140, 3, '咖啡口味的狗', '站在海岸邊跑跑跳跳 唱著歌\r\n被一隻咖啡口味的狗拉著\r\n捲捲的頭髮\r\n毛茸茸的觸感\r\n輕快的腳步\r\n清新的空氣\r\n清澈的海浪聲\r\n時間就這樣停留在我們兩之間\r\n永遠不離開\r\n這樣小小的嚮往\r\n卻帶給我們大大的勇氣 \r\n\r\n\r\n', '2008-12-26 00:00:00', 0000, 15, 0, 7, '腳踩在沙灘 沾滿了沙\r\n\r\n毛茸茸觸感 不是娃娃\r\n\r\n甩甩溼嗒嗒的腳掌\r\n\r\n伸出舌頭 歪歪的笑\r\n\r\n\r\n咖啡色頭髮 閃閃發光\r\n\r\n飄逸吹著風 不想回家\r\n雖然世界這麼寬廣\r\n\r\n但是我會小小的永遠長不大\r\n\r\n\r\n\r\n站在海岸線上 唱著歌 \r\n我看見彩虹\r\n\r\n我奔跑著微笑著過 \r\n牽你的手\r\n\r\n\r\n吹懶洋洋的風 臉紅紅 \r\n你跟著我走\r\n\r\n天涯海角 都不會離開 \r\n一直陪著我\r\n\r\n什麼時候才能夠 完成這個我們倆的夢', '', 262, '', '林奕辰', '張嫚珈', '坦娜普', 'Goodie Music', '', 0, 1, 0, '2008-12-19 02:39:53', '2015-03-12 13:35:38', '0000-00-00 00:00:00'),
(10364, 181, 1193, 1, '夢幻之星 [PHANTASY STAR]', 'KS曾玩過的一款日本TV電玩遊戲，在2002年台灣代理下登場在網際網路線上遊戲，由知名的遊戲廠商（SEGA）公司所開發，因喜愛此款遊戲，且自己接觸電玩遊戲內容本身並對它有一定的了解，而編寫出來的電子舞曲音樂作品，以超夢幻旋律貫穿整首曲子，令玩家們如同身歷其境般的視野！全新的曲子、全新的感受、經典遊戲之作可絕對不能錯過那時的回憶。\n\n作品年份：2002/06月\n更多凱斯音樂請至：http://www.kevinsu.com.tw', '2002-06-03 00:00:00', 0000, 16, 0, 3, '', '', 322, '', 'KS (Kevin Su)', '', 'KS (Kevin Su)', '凱斯音樂', '', 0, 1, 0, '2008-12-19 04:06:45', '2015-03-12 13:35:39', '0000-00-00 00:00:00'),
