(10388, 4643, 1195, 1, '客家小炒', '', '2008-12-26 00:00:00', 0000, 25, 0, 4, '講到好食的客家料理一定有這味\r\n“客家小炒”在咱苗栗這邊叫做”炒肉”\r\n炒一盤好食擱香香的”炒肉”唔免想那多\r\n一般家庭拿來拜拜的三層和魷魚就是主角\r\n炒肉啊  炒肉啊  炒肉啊炒肉啊 好吃的客家小炒\r\n炒肉啊  炒肉啊  炒肉啊炒肉啊 好吃的客家小炒\r\n袂食好食的“客家小炒”唔免去餐廳\r\n一般餐廳炒的”炒肉”實在是唔對味\r\n今嘛馬上教你炒一盤正港的”客家小炒”\r\n你就愛真足聽我阿煜哥慢慢啊唱出來\r\nB段\r\n一塊熟仔三層      “切 切 切”\r\n一塊泡水的魷魚    “切 切 切”\r\n芹菜豆乾          “切 切 切”\r\n還擱(有)辣椒蔥仔   “切 切 切”\r\n切好的三層   先   “炒 炒 炒”\r\n炒擱歸鼎油油      “香 港 港”\r\n剎落那個魷魚嘛放落 “炒 炒 炒”\r\n按呢山產海味就    ”一 家 親”\r\n\r\n鼻到三層跟魷魚的香味慢慢的炒出來\r\n這時豆油跟紅標米酒配料來出場\r\n社會進步”炒肉”愛改良芹菜豆乾就傪入來\r\n尾仔蔥仔辣椒下落芡香按呢好食的”炒肉”就完了                                炒肉啊  炒肉啊  炒肉啊炒肉啊 好吃的客家小炒\r\n炒肉啊  炒肉啊  炒肉啊炒肉啊 好吃的客家小炒\r\n因為過去的農業社會生活卡艱難\r\n袂食”炒肉”唔是逐工你就會凍食的到\r\n食袂完的”炒肉”就愛留擱後頓食擱卡香\r\n這就是頂港有名聲 下港有出名的”客家小炒”啦\r\nTo B段\r\n客家小炒要怎麼炒  客家小炒真好吃\r\n想要炒出客家味    一定要有（那個）客家心\r\n要有客家心（客家心）  正有客家味（客家味）\r\n要有客家心（客家心）  正有客家味（客家味）\r\n', '', 268, '', '黃連煜', '黃連煜', '黃連煜', '喜瑪拉雅', '', 1, 1, 0, '2008-12-19 13:08:31', '2015-03-12 13:35:39', '0000-00-00 00:00:00'),
