(10394, 4643, 1195, 2, '車屢開屢遠', '', '2008-12-26 00:00:00', 0000, 25, 0, 4, '決定離開  唔敢擱越頭想起過去\r\n北風無情  鑽入心肝將阮打醒\r\n已經離開  一個人失神唔知袂去叨位\r\n找沒方向  迷失在都市的暗暝\r\n\r\n車屢開屢遠  心屢來屢疼\r\n真心相愛的你我也要面對無奈的運命\r\n倔強的你甘袂疼\r\n\r\n車屢開屢遠  雨屢落屢透\r\n現實的考驗將咱做夥努力得到的幸福\r\n全部都拆散\r\n\r\n車屢開屢遠  心屢來屢疼\r\n車屢開屢遠  心屢來屢疼\r\n', '', 275, '', '黃連煜', '黃連煜', '黃連煜', '喜瑪拉雅', '', 1, 1, 0, '2008-12-19 13:34:01', '2015-03-12 13:35:40', '0000-00-00 00:00:00');
